import ITZYimg from './assets/ITZY.jpg'
import LEimg from './assets/LE.jpg'
import GIDLEimg from './assets/GIDLE.jpg'

export const GROUP = {
    ITZY: {
        title: "ITZY",
        image: ITZYimg,
        description: "隸屬JYP娛樂,2019年2月12號出道"
    },

    GIDLE: {
        title: "(G)I-DLE",
        image: GIDLEimg,
        description: "隸屬Cube娛樂,2018年5月2日出道"
    },

    LESSERAFIM : {
        title: "LE SSERAFIM",
        image: LEimg,
        description: "隸屬HYPE娛樂,2022年5月2日出道"
    }
};
